window.bookSummaryJSON = "<p><b>For the first time ever, hear the bestselling leadership book of all time, read in its entirety by John Maxwell himself!</b></p> <p>HarperCollins and John C. Maxwell are celebrating the milestone anniversary of Maxwell’s <i>New York Times</i> bestselling book, <i>The 21 Irrefutable Laws of Leadership</i>, with the publication of a revised and updated 25th anniversary edition. This will be the first time Maxwell has read the full unabridged audiobook. Included only on this audio edition are insights from Maxwell on each law and how they have impacted his life as a leader and mentor. There will also be stories from some of today’s most impactful leaders, like entrepreneur and cofounder of IT Cosmetics Jamie Kern Lima, Maxwell Leadership CEO Mark Cole, and author and marketing expert Jeff Henderson, on how they have applied these laws to their own success journeys.</p> <p>Maxwell has gone through every word of this book and updated it for the next generation of leaders. He has added new insights to these timeless laws and included lessons learned since he originally wrote the book 25 years ago. And he has included some exciting new stories that apply the laws to today’s business world.</p> <p>What Maxwell didn’t change are the powerful leadership truths that have been helping people become better leaders for the last quarter century. This is still the best book on leadership people can buy, whether they want to learn leadership on their own, develop as leaders in a group, or teach leadership to others as a mentor.</p> <p><b>Listeners new to Maxwell, as well as lifelong fans, will enjoy this new edition of the leadership book that has sold millions of copies in the United States and around the world.</b></p> <p><b>Accompanying visuals and an assessment are included in the audiobook companion PDF download.</b></p> <p><b>PLEASE NOTE: When you purchase this title, the accompanying PDF will be available in your Audible Library along with the audio.</b></p> <p></p>"; 
